    giorno1 += "                                                <\/center><br>";
    giorno1 += "                                                <center>";
    giorno1 += "                                                    <div class=\"desc2\"><b>Passato:<\/b><br>";
    giorno1 += "                                                        <p style=\"line-height:1.2\">Il tuo cuore è nel lavoro o negli";
    giorno1 += "                                                            studi che fai. Ti sei impegnato a imparare di più nel";
    giorno1 += "                                                            lavoro, nella tua vocazione o in un progetto. Sei";
    giorno1 += "                                                            decisamente sulla strada giusta. Il tuo impegno, le doti e";
    giorno1 += "                                                            le capacità vengono apprezzate e presto saranno";
    giorno1 += "                                                            ricompensate.";
    giorno1 += "                                                            Comunque c’è ancora molto da imparare. Valuta se seguire";
    giorno1 += "                                                            dei corsi relativi ai tuoi interessi o alla tua professione.";
    giorno1 += "                                                            C’è bisogno di un impegno serio nello studio e nella";
    giorno1 += "                                                            ricerca. Potrebbe essere il momento di rimettersi a";
    giorno1 += "                                                            studiare.";
    giorno1 += "                                                            <br><b>Altri significati:<\/b> Abilità artistica.";
    giorno1 += "                                                            Apprendistato. Diligenza. Attenzione ai dettagli.<\/p>";
    giorno1 += "                                                    <\/div>";
    giorno1 += "                                                <\/center><br>";
    giorno1 += "                                                <center>";
    giorno1 += "                                                    <div class=\"desc3\"><b>Presente:<\/b><br>";
    giorno1 += "                                                        <p style=\"line-height:1.2\"><br><b>Situazioni:<\/b> È probabile";
    giorno1 += "                                                            che riceverai notizie che ti metteranno davanti a";
    giorno1 += "                                                            difficoltà o a ritardi. Il messaggio potrebbe provenire da";
    giorno1 += "                                                            qualcuno che parla schiettamente e senza riguardo, ma non";
    giorno1 += "                                                            prenderla sul personale. L’importante è il messaggio, non";
    giorno1 += "                                                            chi e come lo porta.";
    giorno1 += "                                                            <br><b>Persone:<\/b> Un giovane spesso brillante, onesto e";
    giorno1 += "                                                            infinitamente curioso. Una persona analitica, dal brillante";
    giorno1 += "                                                            ingegno che può rivelare la verità insita nella";
    giorno1 += "                                                            situazione. Bello. Razionale. Non emotivo. Impulsivo.";
    giorno1 += "                                                            <br><b>Altri significati:<\/b> Una nuova sfida. Un contratto";
    giorno1 += "                                                            o accordo. Critiche costruttive. Questioni legali.";
    giorno1 += "                                                            Pettegolezzi.<\/p>";
    giorno1 += "                                                    <\/div>";
    giorno1 += "                                                <\/center><br>";
    giorno1 += "                                                <center>";
    giorno1 += "                                                    <div class=\"desc4\"><b>Futuro:<\/b><br>";
    giorno1 += "                                                        <p style=\"line-height:1.2\">Questa situazione è al termine. Per";
    giorno1 += "                                                            fortuna, dopo una fine c’è sempre un nuovo inizio. Potresti";
    giorno1 += "                                                            provare tristezza per ciò che è finito, insieme a una";
    giorno1 += "                                                            sensazione di sollievo. È tempo di andare e accogliere";
    giorno1 += "                                                            l’alba del nuovo giorno. Aspettati un miglioramento delle";
    giorno1 += "                                                            circostanze, che è già in atto.";
    giorno1 += "                                                            Potrebbe essere il momento di cambiare lavoro. Forse hai";
    giorno1 += "                                                            portato a termine un progetto a lungo termine o hai deciso";
    giorno1 += "                                                            di cercare un altro impiego. Non mettere dei limiti alle";
    giorno1 += "                                                            cose meravigliose che l’Universo può donarti. Getta la tua";
