    giorno1 += "                                                                                    altri) al fine di ricevere";
    giorno1 += "                                                                                    informazioni precise e dettagliate.";
    giorno1 += "                                                                                <\/li>";
    giorno1 += "                                                                                <li class=\"p1\"><b>Schemi di base delle";
    giorno1 += "                                                                                        carte:<\/b> scopri gli schemi di";
    giorno1 += "                                                                                    base delle carte che puoi utilizzare";
    giorno1 += "                                                                                    immediatamente e impara a disporre";
    giorno1 += "                                                                                    le carte per domande con risposte sì";
    giorno1 += "                                                                                    \/ no e sulle tempistiche.<\/li>";
    giorno1 += "                                                                                <li class=\"p1\"><b>Schemi avanzati delle";
    giorno1 += "                                                                                        carte:<\/b> apprendi disposizioni";
