    giorno1 += "                                                                            class=\"elementor-text-editor elementor-clearfix\">";
    giorno1 += "                                                                            <p>Familiarizza con le carte dei tarocchi: i";
    giorno1 += "                                                                                loro quattro semi, i 22 archetipi degli";
    giorno1 += "                                                                                arcani maggiori, le carte numerate e";
    giorno1 += "                                                                                quelle di corte (o figure)&nbsp;degli";
    giorno1 += "                                                                                arcani minori. Se desideri conoscere le";
    giorno1 += "                                                                                carte Rider-Waite o Thoth nei";
    giorno1 += "                                                                                loro&nbsp;dettagli, questo è il posto";
    giorno1 += "                                                                                giusto! Gli argomenti includono:<\/p>";
    giorno1 += "                                                                            <ul>";
    giorno1 += "                                                                                <li><b>La storia e la struttura dei";
    giorno1 += "                                                                                        tarocchi:<\/b> scopri le radici";
    giorno1 += "                                                                                    del sistema dei tarocchi, e molto di";
    giorno1 += "                                                                                    più sulla sua struttura altamente";
    giorno1 += "                                                                                    specifica e sui significati";
    giorno1 += "                                                                                    medievali e moderni dietro ogni";
    giorno1 += "                                                                                    seme.<\/li>";
    giorno1 += "                                                                                <li><b>La storia della vita, tutto sugli";
    giorno1 += "                                                                                        arcani maggiori:<\/b> esplora le";
    giorno1 += "                                                                                    22 carte&nbsp;Rider-Waite degli";
    giorno1 += "                                                                                    arcani maggiori – il viaggio";
    giorno1 += "                                                                                    dell’eroe archetipo – influenzate";
    giorno1 += "                                                                                    dal punto di vista medievale, le";
    giorno1 += "                                                                                    carte Thoth psicologicamente ricche";
    giorno1 += "                                                                                    e le più delicate ed eteree carte";
    giorno1 += "                                                                                    dei Tarocchi degli Angeli.<\/li>";
    giorno1 += "                                                                                <li><b>Gli arcani minori, le carte di";
    giorno1 += "                                                                                        corte (o figure) e le carte";
    giorno1 += "                                                                                        numerate:<\/b> scopri i";
    giorno1 += "                                                                                    personaggi delle carte di corte e il";
    giorno1 += "                                                                                    significato delle carte numerate.";
    giorno1 += "                                                                                <\/li>";
    giorno1 += "                                                                                <li><b>Potenti stese dei Tarocchi:<\/b>";
    giorno1 += "                                                                                    padroneggia le potenti stese dei";
    giorno1 += "                                                                                    Tarocchi, inclusa la versione";
    giorno1 += "                                                                                    avanzata della Ruota della Fortuna.";
    giorno1 += "                                                                                <\/li>";
