    giorno1 += "                                                                            <p class=\"p1\">Le immagini sulle carte";
    giorno1 += "                                                                                svolgono un ruolo importante nella";
    giorno1 += "                                                                                creazione della storia e molte carte";
    giorno1 += "                                                                                sono ricche di simbolismi che possono";
    giorno1 += "                                                                                migliorare notevolmente il tuo Card";
    giorno1 += "                                                                                Reading. Ti immergerai nel meraviglioso";
    giorno1 += "                                                                                campo della simbologia. Gli argomenti";
    giorno1 += "                                                                                includono:<\/p>";
    giorno1 += "                                                                            <ul>";
    giorno1 += "                                                                                <li class=\"p1\"><b>Una panoramica sulla";
    giorno1 += "                                                                                        simbologia del Card Reading:<\/b>";
    giorno1 += "                                                                                    Comprendi le metafore delle carte e";
    giorno1 += "                                                                                    impari come ottenere le risposte dai";
    giorno1 += "                                                                                    simboli.<\/li>";
    giorno1 += "                                                                                <li class=\"p1\"><b>L’evoluzione della";
    giorno1 += "                                                                                        simbologia:<\/b> esplora come i";
    giorno1 += "                                                                                    simboli si sono evoluti dai tempi";
    giorno1 += "                                                                                    primitivi e come si evolvono";
    giorno1 += "                                                                                    specificamente per te.<\/li>";
    giorno1 += "                                                                                <li class=\"p1\"><b>Studia le carte degli";
    giorno1 += "                                                                                        Angeli:<\/b> scopri la storia e i";
    giorno1 += "                                                                                    temi mutevoli delle carte basate";
    giorno1 += "                                                                                    sugli Angeli.<\/li>";
    giorno1 += "                                                                                <li class=\"p1\"><b>Esplora il simbolismo";
    giorno1 += "                                                                                        di altre famose carte<\/b>:";
    giorno1 += "                                                                                    esplora il simbolismo delle carte";
    giorno1 += "                                                                                    più care dei tuoi insegnanti.<\/li>";
