    giorno1 += "                                                                                anche per te stesso. Tuttavia, ci sono";
    giorno1 += "                                                                                considerazioni speciali da tenere a";
    giorno1 += "                                                                                mente quando si pratica il Card Reading";
    giorno1 += "                                                                                e con questo corso imparerai tutto ciò.";
    giorno1 += "                                                                                Gli argomenti includono:<\/p>";
    giorno1 += "                                                                            <ul>";
    giorno1 += "                                                                                <li class=\"p1\"><b>Regole base di";
    giorno1 += "                                                                                        connessione:<\/b> stabilire una";
    giorno1 += "                                                                                    connessione calda e premurosa con le";
    giorno1 += "                                                                                    persone e creare uno spazio di";
    giorno1 += "                                                                                    neutralità, apertura e agio.<\/li>";
    giorno1 += "                                                                                <li class=\"p1\"><b>Prepararsi per un";
    giorno1 += "                                                                                        dialogo di successo:<\/b>";
    giorno1 += "                                                                                    conoscere le persone, valutare le";
    giorno1 += "                                                                                    loro esigenze e stabilire un";
    giorno1 += "                                                                                    rapporto etico.<\/li>";
    giorno1 += "                                                                                <li class=\"p1\"><b>L’etica del Card";
    giorno1 += "                                                                                        Reading:<\/b> scopri l’etica";
    giorno1 += "                                                                                    fondamentale del Card Reading e le";
    giorno1 += "                                                                                    cose da fare e non fare.<\/li>";
    giorno1 += "                                                                                <li class=\"p1\"><b>La collaborazione:";
    giorno1 += "                                                                                    <\/b>impara come interagire con";
    giorno1 += "                                                                                    successo con le persone al fine di";
    giorno1 += "                                                                                    fornire un utile supporto.<\/li>";
    giorno1 += "                                                                                <li class=\"p1\"><b>Temi caldi:<\/b>";
    giorno1 += "                                                                                    diventa abile nel gestire domande";
    giorno1 += "                                                                                    specifiche che sentirai di frequente";
    giorno1 += "                                                                                    e comprendi come muoverti in modo";
    giorno1 += "                                                                                    etico.<\/li>";
    giorno1 += "                                                                                <li class=\"p1\"><b>Risoluzione dei";
    giorno1 += "                                                                                        problemi:<\/b> come gestire con";
    giorno1 += "                                                                                    competenza e sensibilità situazioni";
