    giorno3 += "<p class=\"p1\">Nel corso online di <b>Certificazione in Card Reading,<\/b> otto insegnanti di fama mondiale si uniscono per offrirti <b>uno dei programmi di Card Reading più approfonditi e completi al mondo<\/b>.<\/p><p class=\"p1\">Nel corso di dieci intense lezioni, con oltre 25 ore di video, <span class=\"s1\">i<\/span>mparerai i dettagli del Card Reading, le basi dell’intuizione, numerosi potenti schemi di Card Reading, diverse specifiche su come utilizzarli e creare un tuo percorso personale.<\/p><p class=\"p3\"><span class=\"s2\">Questo corso completo presenta le prospettive di più insegnanti per ogni argomento, così non ti limiti a imparare da un solo esperto, ma sentirai una varietà di punti di vista in ogni lezione.<\/span><\/p> <\/div>";
