    giorno3 += "<p class=\"p1\">A volte, quello che sembra un problema in realtà è la risposta alle tue preghiere. Quando chiediamo aiuto, il Cielo può eliminare il vecchio per far spazio al nuovo. In questa fase di transizione, pratica attività rilassanti come lo yoga, la respirazione profonda, l’esercizio fisico e la meditazione. Chiedi che il passaggio sia agevole e armonioso per tutte le persone coinvolte. E sappi che la situazione sta cambiando in meglio!”.<\/p> <\/div>";
