    giorno3 += "<a href=\"\" class=\"elementor-toggle-title\">#2 Come posso avere tutti questi contenuti per sempre?<\/a>";
    giorno3 += "<\/div>";
    giorno3 += "<div id=\"elementor-tab-content-2392\" class=\"elementor-tab-content elementor-clearfix\" data-tab=\"2\" role=\"tabpanel\" aria-labelledby=\"elementor-tab-title-2392\"><p>Acquista il corso in offerta entro mercoledì 11 ottobre 2023 e ricevi subito tutti i contenuti per sempre, anche il certificato, le meditazioni e l’audio in download. Scopri tutti i fantastici bonus di valore che ricevi con <a href=\"https:\/\/cardreadingitalia.it\/corso\/\" target=\"_blank\" rel=\"noopener\">l’acquisto del corso entro mercoledì 11 ottobre 2023 &gt;<\/a><\/p><\/div>";
    giorno3 += "<\/div>";
    giorno3 += "<div class=\"elementor-toggle-item\">";
    giorno3 += "<div id=\"elementor-tab-title-2393\" class=\"elementor-tab-title\" data-tab=\"3\" role=\"tab\" aria-controls=\"elementor-tab-content-2393\" aria-expanded=\"false\">";
