    giorno3 += "<a href=\"\" class=\"elementor-toggle-title\">#3 In quale orario riceverò la email con il link di visione?<\/a>";
    giorno3 += "<\/div>";
    giorno3 += "<div id=\"elementor-tab-content-2393\" class=\"elementor-tab-content elementor-clearfix\" data-tab=\"3\" role=\"tabpanel\" aria-labelledby=\"elementor-tab-title-2393\"><p><span style=\"font-family: arial, sans-serif;\">Ogni mattina, circa alle ore 6:30, riceverai la email con i link riservati di accesso. Se non dovessi riceverla ti basterà accedere nuovamente al <a href=\"https:\/\/cardreadingitalia.it\/\" target=\"_blank\" rel=\"noopener\">link<\/a> ed inserire il tuo nome e il tuo indirizzo email; la pagina ti porterà ai contenuti del giorno.<\/span><\/p><\/div>";
    giorno3 += "<\/div>";
    giorno3 += "<div class=\"elementor-toggle-item\">";
