    giorno3 += "<\/span>";
    giorno3 += "<a href=\"\" class=\"elementor-toggle-title\">#5 Devo avere un computer particolare per ascoltare il Corso online?<\/a>";
    giorno3 += "<\/div>";
    giorno3 += "<div id=\"elementor-tab-content-2395\" class=\"elementor-tab-content elementor-clearfix\" data-tab=\"5\" role=\"tabpanel\" aria-labelledby=\"elementor-tab-title-2395\"><p>Puoi seguire il Corso online da qualsiasi dispositivo: computer, cellulare e tablet di qualsiasi marca (Mac, Windows).<br>Tieni presente che la qualità della visione dipende dalla qualità della tua linea.&nbsp;Puoi scaricare tutti gli audio e ascoltarli comodamente quando e dove vuoi senza dover essere connesso online.<\/p><\/div>";
