    giorno3 += "<div id=\"elementor-tab-content-2398\" class=\"elementor-tab-content elementor-clearfix\" data-tab=\"8\" role=\"tabpanel\" aria-labelledby=\"elementor-tab-title-2398\"><p>Sì, con <a href=\"https:\/\/cardreadingitalia.it\/corso\/\" target=\"_blank\" rel=\"noopener\">l’acquisto del corso &gt;<\/a> ricevi il certificato in due modalità:<\/p><p>1. subito: in area personale, la versione generica senza il nome stampato.<\/p><p>2. entro il 30 novembre 2023: riceverai il pdf personalizzato con il tuo nome e cognome nella email con cui hai acquistato il corso. Se desideri che venga indicato un nome diverso da quello con cui hai effettuato l’acquisto, invia la tua richiesta a segreteria@mylife.it.<\/p><\/div>";
