    giorno4 += "<div class=\"elementor-text-editor elementor-clearfix\">";
    giorno4 += "<p class=\"p1\">Il Card Reading è uno dei potenti strumenti che ha aiutato le persone a connettersi con la propria intuizione per migliaia di anni. È stato usato in tutti gli angoli del mondo per cercare una guida. Per trovare le risposte. Per navigare in situazioni apparentemente impossibili.<\/p><p class=\"p1\">Perché?<\/p><p class=\"p1\">Perché le carte creano una linea diretta di comunicazione con la fonte di connessione: angeli, guide, antenati e maestri ascesi che desiderano aiutarci.<b><br><\/b><\/p> <\/div>";
