    giorno4 += "<div class=\"elementor-widget-container\">";
    giorno4 += "<p class=\"elementor-heading-title elementor-size-default\">Logica dell’abbondanza<\/p> <\/div>";
    giorno4 += "<\/div>";
    giorno4 += "<div class=\"elementor-element elementor-element-ad7c999 elementor-widget elementor-widget-text-editor\" data-id=\"ad7c999\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">";
    giorno4 += "<div class=\"elementor-widget-container\">";
    giorno4 += "<div class=\"elementor-text-editor elementor-clearfix\">";
    giorno4 += "<p class=\"p1\">Se pensi all’abbondanza come a qualcosa che avverrà nel futuro, sarà sempre un passo avanti a te. Vedi, pensa, percepisci l’abbondanza e parlane come di qualcosa che hai già nel presente e ciò accadrà.<\/p> <\/div>";
