    giorno4 += "<div id=\"elementor-tab-content-1901\" class=\"elementor-tab-content elementor-clearfix\" data-tab=\"1\" role=\"tabpanel\" aria-labelledby=\"elementor-tab-title-1901\"><p>Sì il corso è gratuito al 100%.<br>Ogni giorno riceverai video, meditazioni, app carte e libri in pdf.<\/p><\/div>";
