    giorno4 += "<a href=\"\" class=\"elementor-toggle-title\">#2 Come posso avere tutti questi contenuti per sempre?<\/a>";
    giorno4 += "<\/div>";
    giorno4 += "<div id=\"elementor-tab-content-1902\" class=\"elementor-tab-content elementor-clearfix\" data-tab=\"2\" role=\"tabpanel\" aria-labelledby=\"elementor-tab-title-1902\"><p>Acquista il corso in offerta entro mercoledì 11 ottobre 2023 e ricevi subito tutti i contenuti per sempre, anche il certificato, le meditazioni e l’audio in download. Scopri tutti i fantastici bonus di valore che ricevi con <a href=\"https:\/\/cardreadingitalia.it\/corso\/\" target=\"_blank\" rel=\"noopener\">l’acquisto del corso entro mercoledì 11 ottobre 2023 &gt;<\/a><\/p><\/div>";
    giorno4 += "<\/div>";
    giorno4 += "<div class=\"elementor-toggle-item\">";
    giorno4 += "<div id=\"elementor-tab-title-1903\" class=\"elementor-tab-title\" data-tab=\"3\" role=\"tab\" aria-controls=\"elementor-tab-content-1903\" aria-expanded=\"false\">";
