    giorno4 += "<\/span>";
    giorno4 += "<a href=\"\" class=\"elementor-toggle-title\">#3 In quale orario riceverò la email con il link di visione?<\/a>";
    giorno4 += "<\/div>";
    giorno4 += "<div id=\"elementor-tab-content-1903\" class=\"elementor-tab-content elementor-clearfix\" data-tab=\"3\" role=\"tabpanel\" aria-labelledby=\"elementor-tab-title-1903\"><p><span style=\"font-family: arial, sans-serif;\">Ogni mattina, circa alle ore 6:30, riceverai la email con i link riservati di accesso. Se non dovessi riceverla ti basterà accedere nuovamente al <a href=\"https:\/\/cardreadingitalia.it\/\" target=\"_blank\" rel=\"noopener\">link<\/a> ed inserire il tuo nome e il tuo indirizzo email; la pagina ti porterà ai contenuti del giorno.<\/span><\/p><\/div>";
    giorno4 += "<\/div>";
    giorno4 += "<div class=\"elementor-toggle-item\">";
