    giorno4 += "<\/div>";
    giorno4 += "<div id=\"elementor-tab-content-1905\" class=\"elementor-tab-content elementor-clearfix\" data-tab=\"5\" role=\"tabpanel\" aria-labelledby=\"elementor-tab-title-1905\"><p>Puoi seguire il Corso online da qualsiasi dispositivo: computer, cellulare e tablet di qualsiasi marca (Mac, Windows).<br>Tieni presente che la qualità della visione dipende dalla qualità della tua linea.&nbsp;Puoi scaricare tutti gli audio e ascoltarli comodamente quando e dove vuoi senza dover essere connesso online.<\/p><\/div>";
