    giorno6 += "<div class=\"elementor-element elementor-element-532d263 elementor-widget elementor-widget-text-editor\" data-id=\"532d263\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">";
    giorno6 += "<div class=\"elementor-widget-container\">";
    giorno6 += "<div class=\"elementor-text-editor elementor-clearfix\">";
    giorno6 += "<p>APP CARTE<\/p> <\/div>";
    giorno6 += "<\/div>";
