    giorno6 += "<section class=\"elementor-section elementor-top-section elementor-element elementor-element-386c60ea elementor-section-boxed elementor-section-height-default elementor-section-height-default\" data-id=\"386c60ea\" data-element_type=\"section\" data-settings=\"{&quot;background_background&quot;:&quot;classic&quot;}\">";
    giorno6 += "<div class=\"elementor-container elementor-column-gap-default\">";
    giorno6 += "<div class=\"elementor-row\">";
    giorno6 += "<div class=\"elementor-column elementor-col-100 elementor-top-column elementor-element elementor-element-5c7bebe0\" data-id=\"5c7bebe0\" data-element_type=\"column\">";
    giorno6 += "<div class=\"elementor-column-wrap elementor-element-populated\">";
    giorno6 += "<div class=\"elementor-widget-wrap\">";
    giorno6 += "<div class=\"elementor-element elementor-element-381dc638 elementor-widget elementor-widget-heading\" data-id=\"381dc638\" data-element_type=\"widget\" data-widget_type=\"heading.default\">";
    giorno6 += "<div class=\"elementor-widget-container\">";
    giorno6 += "<h2 class=\"elementor-heading-title elementor-size-default\">Vuoi provare il Card Reading Avanzato?";
    giorno6 += "<\/h2> <\/div>";
    giorno6 += "<\/div>";
    giorno6 += "<div class=\"elementor-element elementor-element-44465138 elementor-widget elementor-widget-heading\" data-id=\"44465138\" data-element_type=\"widget\" data-widget_type=\"heading.default\">";
    giorno6 += "<div class=\"elementor-widget-container\">";
    giorno6 += "<h2 class=\"elementor-heading-title elementor-size-default\">Rivolgi la tua domanda agli Angeli <br>Scopri le risposte sul passato, presente e futuro connesse alla tua domanda<\/h2> <\/div>";
    giorno6 += "<\/div>";
    giorno6 += "<div class=\"elementor-element elementor-element-44a39b96 elementor-widget-mobile__width-initial elementor-widget elementor-widget-shortcode\" data-id=\"44a39b96\" data-element_type=\"widget\" data-widget_type=\"shortcode.default\">";
    giorno6 += "<div class=\"elementor-widget-container\">";
    giorno6 += "<center><div class=\"scene scene--card2\">Passato:<div class=\"card2\"><div class=\"card2__face card2__face--front\"><img alt=\"retro\" src=\"..\/GiocoCarte\/carte_3\/carte_retro.jpg\"><\/div><div class=\"card2__face card2__face--back\"><img alt=\"fronte\" src=\"..\/GiocoCarte\/carte_3\/carte_tarocchi_angeli_9.jpg\"><\/div><\/div><\/div><div class=\"scene2 scene2--card3\">Presente:<div class=\"card3\"><div class=\"card3__face card3__face--front\"><img alt=\"retro\" src=\"..\/GiocoCarte\/carte_3\/carte_retro.jpg\"><\/div><div class=\"card3__face card3__face--back\"><img alt=\"fronte\" src=\"..\/GiocoCarte\/carte_3\/carte_tarocchi_angeli_39.jpg\"><\/div><\/div><\/div><div class=\"scene3 scene3--card4\">Futuro:<div class=\"card4\"><div class=\"card4__face card4__face--front\"><img alt=\"retro\" src=\"..\/GiocoCarte\/carte_3\/carte_retro.jpg\"><\/div><div class=\"card4__face card4__face--back\"><img alt=\"fronte\" src=\"..\/GiocoCarte\/carte_3\/carte_tarocchi_angeli_19.jpg\"><\/div><\/div><\/div><\/center><br><center><div class=\"desc2\"><b>Passato:<\/b><br><p style=\"line-height:1.2\">Questa carta viene a te perché stai cercando di prendere una decisione. Gli angeli ti guidano affinché valuti saggiamente e con attenzione le decisioni in modo che siano eque nei confronti di tutte le persone coinvolte (compreso te stesso). Se non riesci a essere obiettivo, cerca qualcuno che possa fare da arbitro.";
    giorno6 += "Questa carta significa anche che verrà presa una decisione in tuo favore. Se attualmente ti trovi in un contenzioso legale, vedrai che avrà un esito positivo. Inoltre, è importante leggere attentamente i documenti legali e i contratti, prima di firmarli.";
    giorno6 += "<br><b>Altri significati:<\/b> Fare la cosa giusta. Assumersi la responsabilità delle proprie azioni. Opporsi all’ingiustizia. Difendere le proprie convinzioni.";
    giorno6 += "Decisioni eque e giuste. Fai ciò che reputi giusto. Difendi ciò in cui credi. Porgere o ricevere delle scuse.";
    giorno6 += "<br><i>Raguel è l’arcangelo che crea l’armonia nelle relazioni e può aiutarti a prendere decisioni che coinvolgono anche altre persone. Invoca Raguel per portare la pace tra te e gli altri.<\/i><\/p><\/div><\/center><br><center><div class=\"desc3\"><b>Presente:<\/b><br><p style=\"line-height:1.2\">È il momento di un grande festeggiamento! Sono probabili matrimoni, gravidanze, nuove nascite e riconciliazioni. Lauree o promozioni all’orizzonte.";
    giorno6 += "Hai bisogno di divertirti di più! Stai lavorando troppo e devi imparare a rilassarti. Organizza una festa o prenditi una vacanza.";
    giorno6 += "<br><b>Altri significati:<\/b> Comunità. Ospitalità. Intrattenimento. Fortuna. Felici conclusioni.<\/p><\/div><\/center><br><center><div class=\"desc4\"><b>Futuro:<\/b><br><p style=\"line-height:1.2\">Tutti vivono momenti di paura o incertezza. A volte queste paure dipendono da fattori esterni che puoi vedere, altre volte invece le preoccupazioni germinano da paure irrazionali o irreali. In entrambi i casi l’importante è andare dentro di te e ascoltare l’intuito per decidere il da farsi. Chiedi al tuo sé interiore qual è la fonte dell’ansia che provi, e fidati della sua guida.";
    giorno6 += "Gli angeli ti hanno inviato questa carta perché è un momento di grande intuizione e abilità psichica. Tuttavia, le più grandi rivelazioni riguarderanno te stesso. Accogli questo periodo di autoconsapevolezza per superare i blocchi del passato, che finora ti hanno trattenuto. Risvegliati con la verità su chi sei davvero, che hai tenuto nascosta, e contempla la tua luce.";
    giorno6 += "<br><b>Altri significati:<\/b> Fare attenzione ai propri sogni. Eventi nascosti ti stanno influenzando. Illusioni.";
