    giorno6 += "<div class=\"elementor-element elementor-element-da85d83 elementor-blockquote--skin-border elementor-blockquote--button-color-official elementor-widget elementor-widget-blockquote\" data-id=\"da85d83\" data-element_type=\"widget\" data-widget_type=\"blockquote.default\">";
    giorno6 += "<div class=\"elementor-widget-container\">";
    giorno6 += "<blockquote class=\"elementor-blockquote\">";
    giorno6 += "<p class=\"elementor-blockquote__content\">";
    giorno6 += "\"Corso straordinario, apprendimento assolutamente geniale dai più brillanti maestri, dotati e stimolanti. Imparare da tutti loro è stato così meraviglioso. È come se ci fosse tutto in questo tempo e spazio e tu sei una parte essenziale di qualcosa di significativo e gioioso. Ho sperimentato una crescita interiore considerevole. E’ il regalo più speciale che puoi fare a te stesso, è il passo più sorprendente del mio viaggio.\" <\/p>";
