    giorno6 += "<div class=\"elementor-widget-container\">";
    giorno6 += "<p class=\"elementor-heading-title elementor-size-default\">L'universo non vede l’ora di comunicare con noi. Dobbiamo solo ascoltarlo.<\/p> <\/div>";
    giorno6 += "<\/div>";
    giorno6 += "<div class=\"elementor-element elementor-element-fa1076f elementor-widget elementor-widget-text-editor\" data-id=\"fa1076f\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">";
    giorno6 += "<div class=\"elementor-widget-container\">";
    giorno6 += "<div class=\"elementor-text-editor elementor-clearfix\">";
    giorno6 += "<p class=\"p1\">Il Card Reading è uno dei potenti strumenti che ha aiutato le persone a connettersi con la propria intuizione per migliaia di anni. È stato usato in tutti gli angoli del mondo per cercare una guida. Per trovare le risposte. Per navigare in situazioni apparentemente impossibili.<\/p><p class=\"p1\">Perché?<\/p><p class=\"p1\">Perché le carte creano una linea diretta di comunicazione con la fonte di connessione: angeli, guide, antenati e maestri ascesi che desiderano aiutarci.<b><br><\/b><\/p> <\/div>";
