    giorno6 += "<div class=\"elementor-element elementor-element-6794a78 elementor-widget elementor-widget-heading\" data-id=\"6794a78\" data-element_type=\"widget\" data-widget_type=\"heading.default\">";
    giorno6 += "<div class=\"elementor-widget-container\">";
    giorno6 += "<h3 class=\"elementor-heading-title elementor-size-default\">Ogni tipologia di carte è un portale<\/h3> <\/div>";
    giorno6 += "<\/div>";
    giorno6 += "<div class=\"elementor-element elementor-element-31dd775 elementor-widget elementor-widget-text-editor\" data-id=\"31dd775\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">";
    giorno6 += "<div class=\"elementor-widget-container\">";
    giorno6 += "<div class=\"elementor-text-editor elementor-clearfix\">";
    giorno6 += "<p class=\"p1\">Ogni carta è una storia che aspetta di essere raccontata.&nbsp;<span style=\"font-size: inherit; text-align: inherit; color: var( --e-global-color-text ); font-family: var( --e-global-typography-text-font-family ), Sans-serif; font-weight: var( --e-global-typography-text-font-weight ); letter-spacing: -0.015em;\">E se sai come leggere quelle storie, puoi ottenere non solo risposte incredibilmente chiare alle domande che poni, ma anche <\/span><b style=\"font-size: inherit; text-align: inherit; color: var( --e-global-color-text ); font-family: var( --e-global-typography-text-font-family ), Sans-serif; letter-spacing: -0.015em;\">un’entusiasmante mappa del viaggio spirituale di qualcuno, incluso il tuo.&nbsp;<\/b><span style=\"font-size: inherit; text-align: inherit; color: var( --e-global-color-text ); font-family: var( --e-global-typography-text-font-family ), Sans-serif; font-weight: var( --e-global-typography-text-font-weight ); letter-spacing: -0.015em;\">Quando comprendi come interpretare le carte, ti apri a una scelta di <\/span><b style=\"font-size: inherit; text-align: inherit; color: var( --e-global-color-text ); font-family: var( --e-global-typography-text-font-family ), Sans-serif; letter-spacing: -0.015em;\">straordinarie possibilità<\/b><span style=\"font-size: inherit; text-align: inherit; color: var( --e-global-color-text ); font-family: var( --e-global-typography-text-font-family ), Sans-serif; font-weight: var( --e-global-typography-text-font-weight ); letter-spacing: -0.015em;\">. Perché l’interpretazione delle carte illustra le esperienze passate, le situazioni presenti e rivela anche potenziali futuri.&nbsp;<\/span><span style=\"font-size: inherit; text-align: inherit; color: var( --e-global-color-text ); font-family: var( --e-global-typography-text-font-family ), Sans-serif; font-weight: var( --e-global-typography-text-font-weight ); letter-spacing: -0.015em;\">Scorgere la storia nelle carte ti dà un “segnale” su ciò che tu o un’altra persona potreste dover affrontare se non cambierete rotta. Le carte ti sintonizzano su aree della tua vita che richiedono particolare interesse e ti permettono di accedere a modi utili per muoverti nella realtà.<\/span><\/p><p class=\"p1\">Quando crei una connessione con la tua interiorità, ti apri all’intuizione superiore che ti aiuterà in ogni ambito. <span style=\"font-size: inherit; text-align: inherit; color: var( --e-global-color-text ); font-family: var( --e-global-typography-text-font-family ), Sans-serif; font-weight: var( --e-global-typography-text-font-weight ); letter-spacing: -0.015em;\">Immagina di non avere più decisioni da prendere per le quali ti senti in dubbio. Niente più confusione sulle grandi scelte di vita, come i tuoi partner romantici, la tua carriera e il tuo scopo della vita. Anche le domande più semplici e quotidiane assumono un aspetto completamente nuovo quando ti connetti alla visione multidimensionale dell’Universo.<\/span><\/p><p class=\"p1\">Questa è la bellezza di essere un Card Reader. Puoi ottenere risposte per te stesso, i tuoi amici, i tuoi cari e anche per gli altri.&nbsp;<span style=\"font-size: inherit; text-align: inherit; color: var( --e-global-color-text ); font-family: var( --e-global-typography-text-font-family ), Sans-serif; font-weight: var( --e-global-typography-text-font-weight ); letter-spacing: -0.015em;\">Chiunque può imparare a interpretare le carte oracolari e i tarocchi.&nbsp;<\/span><span style=\"font-size: inherit; text-align: inherit; color: var( --e-global-color-text ); font-family: var( --e-global-typography-text-font-family ), Sans-serif; font-weight: var( --e-global-typography-text-font-weight ); letter-spacing: -0.015em;\">Il corso online <\/span><i style=\"font-size: inherit; text-align: inherit; color: var( --e-global-color-text ); font-family: var( --e-global-typography-text-font-family ), Sans-serif; font-weight: var( --e-global-typography-text-font-weight ); letter-spacing: -0.015em;\">Certificazione in Card Reading <\/i><span style=\"font-size: inherit; text-align: inherit; color: var( --e-global-color-text ); font-family: var( --e-global-typography-text-font-family ), Sans-serif; font-weight: var( --e-global-typography-text-font-weight ); letter-spacing: -0.015em;\">ti insegnerà come fare!<\/span><\/p> <\/div>";
    giorno6 += "<\/div>";
