    giorno6 += "<p class=\"p1\">Radleigh Valentine è l’autore di tarocchi più rilevante di Hay House, ha realizzato cinque mazzi di tarocchi, un mazzo di carte oracolari e un libro, tutti con Doreen Virtue. È anche autore di <em>Diventa Geniale<\/em>. Insegnante spirituale di fama internazionale, dal 2012 ha partecipato come relatore ad oltre 70 eventi in 10 paesi, tra cui oltre una dozzina di eventi <em>I Can Do It<\/em>&nbsp;di Hay House.<\/p><p class=\"p1\">Radleigh partecipa anche regolarmente al summit annuale Hay House World ed è un oratore frequente al Summit Angel World di Londra e all’Engelkongress in Germania e Austria. Il suo programma radiofonico di Hay House, <em>Magical Things with Radleigh Valentine<\/em>, è un misto di insegnamento attraverso risate e letture struggenti. Il suo popolare video show <em>Ask Rad! <\/em>va in onda su Facebook e Instagram contemporaneamente ogni settimana.<\/p> <\/div>";
    giorno6 += "<\/div>";
    giorno6 += "<\/div>";
