    giorno6 += "<div class=\"elementor-element elementor-element-b8f0050 elementor-widget elementor-widget-heading\" data-id=\"b8f0050\" data-element_type=\"widget\" data-widget_type=\"heading.default\">";
    giorno6 += "<div class=\"elementor-widget-container\">";
    giorno6 += "<h4 class=\"elementor-heading-title elementor-size-default\">DENISE LINN<\/h4> <\/div>";
    giorno6 += "<\/div>";
    giorno6 += "<div class=\"elementor-element elementor-element-6ca2736 elementor-widget elementor-widget-text-editor\" data-id=\"6ca2736\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">";
    giorno6 += "<div class=\"elementor-widget-container\">";
    giorno6 += "<div class=\"elementor-text-editor elementor-clearfix\">";
    giorno6 += "<p class=\"p1\">Il viaggio personale di Denise Linn è iniziato a seguito di un’esperienza di pre-morte all’età di 17 anni. Le sue esperienze stravolgenti e la sua straordinaria guarigione l’hanno avviata ad una ricerca spirituale che l’ha portata a esplorare le tradizioni curative di molte culture, comprese quelle dei suoi stessi antenati Cherokee, gli aborigeni della savana australiana e gli Zulu in Bophuthatswana. Si è allenata con un kahuna hawaiano (sciamano) e il maestro di Reiki Hawayo Takata. È stata anche adottata da una tribù Maori della Nuova Zelanda. Inoltre ha vissuto in un monastero buddista zen per più di due anni.<br>Denise è un’insegnante di fama internazionale nel campo della crescita personale. È autrice di tanti bestseller, tra cui <em>Spazio sacro<\/em>&nbsp;e <em>Soul coaching<\/em>&nbsp;disponibili in 29 lingue. Denise è apparsa in numerosi documentari e programmi televisivi in tutto il mondo.<\/p> <\/div>";
