    giorno6 += "<div class=\"elementor-element elementor-element-4967333 elementor-widget elementor-widget-text-editor\" data-id=\"4967333\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">";
    giorno6 += "<div class=\"elementor-widget-container\">";
    giorno6 += "<div class=\"elementor-text-editor elementor-clearfix\">";
    giorno6 += "<p class=\"p1\">Kyle Gray ha avuto esperienze spirituali sin dalla tenera età. Quando aveva solo quattro anni, l’anima di sua nonna gli fece visita dall’aldilà. Crescendo, Kyle ha sempre avuto la capacità di ascoltare, sentire e vedere ciò che va oltre i sensi naturali, che alla fine lo ha portato a scoprire il potere e l’amore degli angeli nella sua adolescenza. Ora, Kyle è uno degli esperti più seguiti nel suo campo. Con la sua capacità unica di rimanere radicato e ben presente nel momento, reintroduce l’idea degli angeli e della spiritualità in modo accessibile a un pubblico moderno, rendendo le antiche conoscenze spirituali rilevanti per il lettore di oggi. Kyle tiene conferenze in tutto il mondo e i suoi corsi nel Regno Unito e in Europa sono andati spesso sold out. Vive a Glasgow, in Scozia, ed è autore di sette libri e quattro mazzi di carte.<\/p> <\/div>";
