    giorno6 += "<div class=\"elementor-widget-container\">";
    giorno6 += "<h4 class=\"elementor-heading-title elementor-size-default\">SANDRA ANNE TAYLOR <\/h4> <\/div>";
    giorno6 += "<\/div>";
    giorno6 += "<div class=\"elementor-element elementor-element-c33b006 elementor-widget elementor-widget-text-editor\" data-id=\"c33b006\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">";
    giorno6 += "<div class=\"elementor-widget-container\">";
    giorno6 += "<div class=\"elementor-text-editor elementor-clearfix\">";
    giorno6 += "<p class=\"p1\">Sandra Anne Taylor è l’autrice best seller del New York Times del volume <em><b>Il codice delle vite passate, scopri il tuo karma e programma un futuro più luminoso. <\/b><\/em>Sandra è nota per i suoi processi ispiranti e le sue tecniche rivoluzionarie che incorporano coscienza, karma ed energia impiegate nella trasformazione personale. I suoi libri sono disponibili in 26 lingue in tutto il mondo.<\/p> <\/div>";
    giorno6 += "<\/div>";
