    giorno6 += "<div class=\"elementor-widget-container\">";
    giorno6 += "<div class=\"elementor-image\">";
    giorno6 += "<img decoding=\"async\" width=\"580\" height=\"580\" src=\"https:\/\/cardreadingitalia.it\/wp-content\/uploads\/2020\/11\/sandra-anne-taylor.jpg\" class=\"attachment-large size-large wp-image-86\" alt=\"\" loading=\"lazy\" srcset=\"https:\/\/cardreadingitalia.it\/wp-content\/uploads\/2020\/11\/sandra-anne-taylor.jpg 600w, https:\/\/cardreadingitalia.it\/wp-content\/uploads\/2020\/11\/sandra-anne-taylor-300x300.jpg 300w, https:\/\/cardreadingitalia.it\/wp-content\/uploads\/2020\/11\/sandra-anne-taylor-150x150.jpg 150w\" sizes=\"(max-width: 580px) 100vw, 580px\"> <\/div>";
