    giorno6 += "<div class=\"elementor-widget-container\">";
    giorno6 += "<h4 class=\"elementor-heading-title elementor-size-default\">SHARON ANNE KLINGLER<\/h4> <\/div>";
    giorno6 += "<\/div>";
    giorno6 += "<div class=\"elementor-element elementor-element-35704f4 elementor-widget elementor-widget-text-editor\" data-id=\"35704f4\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">";
    giorno6 += "<div class=\"elementor-widget-container\">";
    giorno6 += "<div class=\"elementor-text-editor elementor-clearfix\">";
    giorno6 += "<p class=\"p1\">Sharon Anne Klingler ha cominciato a indagare su una coscienza più grande a seguito delle sue straordinarie esperienze come gemella identica. Tiene conferenze in tutto il mondo su argomenti quali reincarnazione, padronanza spirituale, sviluppo intuitivo, comunicazione spirituale e medianità pubblica per professionisti.<\/p><p class=\"p1\">Membro della International Mediums League e della Lily Dale Mediums League, Sharon ha dimostrato la sua abilità nella comunicazione spirituale in tre continenti, dall’Europa ai paesi del Sud Pacifico. Il suo primo libro è stato<em> Intuition &amp; Beyond<\/em>, pubblicato da Random House a Londra. Altri suoi titoli sono <em>Travel into Your Past Lives, Drawing on Your Intuition, Life with Spirit, Divine Connections<\/em>. Il suo acclamato programma <em>Speaking to Spirit<\/em> è un seminario completo di studio a casa per lo sviluppo intuitivo e della medianità. I suoi articoli e recensioni sono stati pubblicati su riviste di tutto il mondo tra cui Daily Express (Londra), Now magazine (Sydney), Eve magazine (Londra) e Creations (New York). Sharon è apparsa su ITV Inghilterra, Vision TV Canada, NBC, ABC, CBS e BBC. Sharon è una leader internazionale intuitiva che ha gestito con successo uno studio privato per oltre 25 anni con clienti di alto profilo in tutto il mondo. È suo desiderio che tutte le persone conoscano la grande presenza dello spirito, sia lo spirito che è in loro che le guide ultraterrene che cercano di condividere le loro conoscenze e la loro assistenza.<\/p> <\/div>";
    giorno6 += "<\/div>";
