    giorno6 += "<div class=\"elementor-widget-container\">";
    giorno6 += "<div class=\"elementor-text-editor elementor-clearfix\">";
    giorno6 += "<p class=\"p1\">Colette Baron-Reid è un’esperta di Oracoli acclamata a livello internazionale, medium spirituale e autrice ispirazionale best seller tradotta in 27 lingue. Come medium spirituale partecipa anche al programma televisivo <em><span class=\"s1\">Messages from Spirit <\/span><\/em>(Amazon Prime\/YouTube). Colette divide il suo tempo tra gli Stati Uniti e il Canada con suo marito e 2 adorabili cani. Quando non crea mazzi di carte oracolari e insegna al pubblico globale, scrive canzoni, canta e registra musica rilassante.<\/p> <\/div>";
