    giorno6 += "<p class=\"p1\">Rebecca Campbell è scrittrice e artista, conduce laboratori di attivazione a livello internazionale, offrendo un’esperienza di connessione interiore. È autrice di libri e mazzi di oracoli, tra cui <em>Light Is the New Black<\/em> e <em>Work Your Light Oracle<\/em>, e la creatrice di Rise Sister Rise Membership. Attraverso le sue creazioni, Rebecca incoraggia le persone di tutto il mondo a trascorrere più tempo con la propria anima e connettersi al proprio Tempio Interiore.<\/p> <\/div>";
